import React from 'react';

class App extends React.Component{
    render(){
        return(
            <header>
                <form id="to-do-form">
                    <input type="text" placeholder="Enter Text" />
                    <button type="submit">Add</button>
                </form>
            </header>
        );
    }
}
export default App;
